import { Link } from "react-router-dom";
import logo from "../assets/logo.jpg";

const Ribbon = () => {
  return (
    <nav className="flex gap-[8rem] justify-evenly items-center py-2 px-4">
      <Link href="/" className="text-[3rem] text-khamco-primary no-underline font-minimoBold">
        <img src={logo} alt="" style={{ width: "40%" }} />
      </Link>
      <input type="checkbox" name="topnav" id="topnav" className="hidden" />
      <label htmlFor="topnav">
        <i className="fas fa-bars"></i>
      </label>
      <label htmlFor="topnav">
        <i className="fas fa-times"></i>
      </label>
      <ul>
        <Link to="/">Main Menu</Link>
      </ul>
    </nav>
  );
};

export default Ribbon;
